    [],nt"num_tags": 13,nt"name": "refuge-narrative-report-september-december-1963-kenai-national-moose-range",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Wildlife Refuge summarizes refuge activities from September through December of
    1963.  The report begins with general information about weather conditions and habitat
    conditions on the refuge.  Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predacious birds, and fish- is also covered.  The
    report includes a refuge development section which discusses physical developments,
    plantings, control of vegetation, and fires on the refuge.  Refuge resources are
    outlined; timber removal, fur harvest, and commercial fishing were the primary resources
    used during this period.  A progress report on field investigations and research
    is provided. The public relations section of the report discusses recreational uses
    of the refuge, refuge visitors, refuge participation, hunting, violations, and safety.
     Maps and N-R forms are provided at the end of the report.",nt"owner_org":
